import { CheckOutlined } from "@ant-design/icons"

const SearchButtonDiv = styled.div`
  padding: 3rem 0;
  width: 100%;
  .swiper-button-next, .swiper-button-prev {
    color: black;
  }
  .swiper-button-next {
    padding-left: 30px;
  }
  .swiper-button-prev {
    padding-right: 30px;
  }
  .swiper-button-next:after, .swiper-button-prev:after {
    font-size: 17px;
    font-weight: bold;
  }
  .swiper-slide {
    display: flex;
    flex-direction: column;
    align-items: center;
    div {
      width: 62px;
      height: 62px;
      border-radius: 50%;
      background-color: rgb(240, 243, 243);
      display: flex;
      -webkit-box-pack: center;
      justify-content: center;
      -webkit-box-align: center;
      align-items: center;
      position: relative;
      span {
        color: white;
      }
    }
    div.checked {
      content: "";
      inset: 0px;
      border-radius: 50%;
      background-color: rgb(23, 161, 255);
      mix-blend-mode: normal;
      opacity: 0.8;
    }
  }
`

